import React, { useState } from 'react';
import GenderDropdown from './dropdowns/Gender';
import { Genders } from './dropdowns/menus/options'; // Importing Genders from options.js
import './App.css';

function App() {
  const [selectedGender, setSelectedGender] = useState('');

  const handleSelectGender = (selectedOption) => {
    setSelectedGender(selectedOption.value);
  };

  const handleSubmit = () => {
    if (!selectedGender) {
      alert('Please select a gender.');
      return;
    }
    console.log('Selected gender:', selectedGender);
    // Perform further actions with the selected gender
  };

  return (
    <div className="App">
      <h1>Gender Selection</h1>
      <GenderDropdown options={Genders} onSelectGender={handleSelectGender} />
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
}

export default App;
